/* ==================================================
 บุคคลธรรมดา
==================================================
 */
<template>
  <div id="app"></div>
</template>

<script>
import pdfMake from "pdfmake";
import pdfFonts from "../../assets/custom-fonts.js"; // 1. import custom fonts
export default {
  name: "App",
  data() {
    return {
      comName: "หจก.อินฟินิตี้ฟีโนมีนอลซอฟท์แวร์",
      comAddr: "633/144หมู่บ้านกาญจน์กนกทาวน์โฮม4",
      comTel: "052-005-509",
      comTaxNum: "0503561005794",
      comEmail: "infinityp.soft@gmail.com",
      invID: "INVYYMM-XXX",
      invDate: "17/05/2022",
      invSeller: "Phirachat",
      invSellerTel: "087-5458849",

      cusName: "บริษัท ชิปโปรมาโคร จำกัด",
      cusAddr: "226/1 หมู่ 2 ต.สันผักหวาน อ.หางดง จ.เชียงใหม่",
      cusTax: "0605558001296",

      bankName: "ธนาคารกสิกรไทย",
      bankNumber: "0-5438-7366-7",
      bankAccName: "หจก.อินฟินิตี้ ฟิโนมีนอล ซอฟท์แวร์",

      price: "1,588,785.05",
      tax7: "111,214,95",
      priceaftertax7: "1,700,000",
      netprice: "1,700,000",
    };
  },
  mounted() {
    this.export();
  },
  methods: {
    export() {
      pdfMake.vfs = pdfFonts.pdfMake.vfs;
      pdfMake.fonts = {
        // download default Roboto font from cdnjs.com
        Roboto: {
          normal:
            "https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Regular.ttf",
          bold: "https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Medium.ttf",
          italics:
            "https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-Italic.ttf",
          bolditalics:
            "https://cdnjs.cloudflare.com/ajax/libs/pdfmake/0.1.66/fonts/Roboto/Roboto-MediumItalic.ttf",
        },
        Kanit: {
          // 3. set Kanit font
          normal: "Kanit-Regular.ttf",
          bold: "Kanit-Medium.ttf",
          italics: "Kanit-Italic.ttf",
          bolditalics: "Kanit-MediumItalic.ttf",
        },
      };
      const dd = {
        pageSize: "A4",
        background: [
          {
            image: "stamp",
            width: "550",
            opacity: 0.1,
            absolutePosition: { x: 20, y: 150 },
          },
        ],

        /* text: "test watermark", */

        /* color: "black", */
        /* opacity: 0.8, */
        /* bold: true, */
        /* italics: false, */
        content: [
          {
            alignment: "justify",
            columns: [
              {
                image: "stamp",
                width: 80,
                style: "lineSpacing2",
              },
              { width: "*", text: "" },
              {
                margin: [0, 30, 0, 0],
                width: 130,
                fontSize: 20,
                alignment: "left",
                text: "ใบวางบิล",
              },
            ],
          },
          {
            alignment: "justify",
            columns: [
              {
                width: "auto",
                alignment: "left",
                fontSize: 10,
                bold: false,
                text: [
                  this.comName +
                    "\nที่อยู่: " +
                    this.comAddr +
                    "\nเบอร์โทร: " +
                    this.comTel +
                    "\nเลขผู้เสียภาษี: " +
                    this.comTaxNum +
                    "\n อีเมล: " +
                    this.comEmail,
                ],
              },
              {
                width: "*",
                text: "",
              },
              {
                width: 140,
                alignment: "left",
                fontSize: 10,
                type: "none",
                ol: [
                  "เลขที่: " + this.invID,
                  "วันที่: " + this.invDate,
                  "ผู้ขาย: " + this.invSeller,
                  "เบอร์: " + this.invSellerTel,
                ],
              },
            ],
            style: "lineSpacing2",
          },

          /* customer here */

          {
            alignment: "justify",
            columns: [
              {
                width: "auto",
                alignment: "left",
                fontSize: 10,
                bold: false,
                text: [
                  {
                    text: "ลูกค้า: ",
                    bold: true,
                  },
                  {
                    text: this.cusName,
                  },
                  {
                    text: "\nที่อยู่: ",
                    bold: true,
                  },
                  {
                    text: this.cusAddr,
                  },
                  {
                    text: "\nเลขทะเบียนนิติบุคคล: ",
                    bold: true,
                  },
                  {
                    text: this.cusTax,
                  },
                ],
              },
            ],
            style: "lineSpacing2",
          },

          /* customer end */

          /* ============================================
          detail section place here 
          ============================================ */
          {
            alignment: "center",
            columns: [
              /* { width: "*", text: "" }, */
              {
                style: "tableExample",
                alignment: "center",

                table: {
                  widths: [30, "*", 30, 100, 100],
                  fontSize: 10,
                  body: [
                    /* table header */
                    [
                      {
                        fontSize: 10,
                        border: [false, false, false, true],
                        fillColor: "#4E4D4D",
                        text: "#",
                        color: "white",
                      },
                      {
                        fontSize: 10,
                        border: [false, false, false, true],
                        fillColor: "#4E4D4D",
                        color: "white",
                        text: "รายละเอียด",
                      },
                      {
                        fontSize: 10,
                        border: [false, false, false, true],
                        fillColor: "#4E4D4D",
                        text: "จำนวน",
                        color: "white",
                      },
                      {
                        fontSize: 10,
                        border: [false, false, false, true],
                        fillColor: "#4E4D4D",
                        text: "ราคาต่อหน่วย",
                        color: "white",
                      },
                      {
                        fontSize: 10,
                        border: [false, false, false, true],
                        fillColor: "#4E4D4D",
                        text: "ราคารวม",
                        color: "white",
                      },
                    ],
                    /* here where to put data  */
                    [
                      "1",
                      "ค่าบริการพัฒนาระบบศูนย์ไตเทียม",
                      "1 ",
                      "1,700,000",
                      "1,700,000",
                    ],
                  ],
                },
                layout: "lightHorizontalLines" /* {
                  defaultBorder: false,
                }, */,
              },
              /*  { width: "*", text: "" }, */
            ],
            style: "lineSpacing3",
          } /* ============================================
          detail section end here 
          ============================================ */,

          /* ============================================
          Payment section place here 
          ============================================ */
          {
            alignment: "justify",
            columns: [
              {
                width: "auto",
                alignment: "center",
                fontSize: 10,
                bold: false,
                text: "(หนึ่งล้านหกแสนหาหมื่นสองพันสามร้อยสามสิบหกจุดสี่สิบห้าสตางค์)",
              },
              {
                width: "*",
                alignment: "right",
                fontSize: 10,
                type: "none",
                ol: [
                  "ราคาก่อนภาษี : " + this.price + " บาท",
                  "ภาษี 7% : " + this.tax7 + " บาท",
                  "ราคารวมภาษีมูลค่าเพิ่ม 7% : " + this.priceaftertax7 + " บาท",
                  "รวมเงินสุทธิ : " + this.netprice + " บาท",
                ],
                style: {
                  lineHeight: 1.2,
                  bold: false,
                  border: [false, false, false, true],
                },
              },
            ],
            style: "lineSpacing4",
          },

          /*           =============================================
          sign section 
          ============================================= */
          {
            height: "*",
            alignment: "justify",
            columns: [
              {
                width: 1,
                canvas: [
                  {
                    type: "rect",
                    x: 5,
                    y: 4,
                    w: 10,
                    h: 10,
                    /* color: "#7a7a7a", */
                    border: 'black',
                    fillOpacity: 0.5,
                  },
                ],
              },
              {
                width: "*",
                alignment: "left",
                margin: [20,2,0,0],
                fontSize: 10,
                bold: false,
                text: [
                  {
                    text: "โอนผ่าน",
                    bold: true,
                  },
                  {
                    text: this.bankName,
                  },
                  {
                    text: "\nเลขบัญชี ",
                    bold: true,
                  },
                  {
                    text: this.bankNumber,
                  },
                  {
                    text: "\nชื่อบัญชี ",
                    bold: true,
                  },
                  {
                    text: this.bankAccName,
                  },
                  
                ],
              },
              {
                width:120,
                text: "",
              },
              {
                width: "*",
                alignment: "left",
                fontSize: 10,
                type: "none",
                text: [
                  {
                    text: "ในนามของ ",
                    bold: true,
                  },
                  {
                    text: this.comName,
                  },
                  {
                    alignment: "center",
                    lineHeight:5,
                    text:" ",
                  },
                  {
                   alignment: "center",
                    text: "\nผู้รับเงิน ",
                    bold: true,
                    margin: [ 0, 5, 0, 0 ],
                  },
                  {
                   alignment: "center",
                    text: "\n(                                               ) ",
                    bold: true,
                    margin: [ 0, 5, 0, 0 ],
                  },
                  {
                    alignment: "center",
                    text: "\n" + this.invDate,
                  },
                ],
                style: {
                  lineHeight: 1.2,
                  bold: false,
                  border: [false, false, false, true],
                },
              },      
            ],
            style: "lineSpacing",
          },

          /* 
          ============================================
          end of sign section
          ============================================ */
        ],
        images: {
          stamp:
            "data:image/jpeg;base64,",
        },
        styles: {
          header: {
            fontSize: 18,
            bold: true,
            margin: [0, 0, 0, 10],
          },
          subheader: {
            fontSize: 16,
            bold: true,
            margin: [0, 10, 0, 5],
          },
          tableExample: {
            margin: [0, 5, 0, 15],
          },
          tableHeader: {
            bold: true,
            fontSize: 13,
            color: "black",
          },

          lineSpacing: {
            margin: [0, 0, 0, 6], //change number 6 to increase nspace
          },
          lineSpacing2: {
            margin: [0, 0, 0, 10], //change number 6 to increase nspace
          },
          lineSpacing3: {
            margin: [0, 0, 0, 20], //change number 6 to increase nspace
          },
          lineSpacing4: {
            margin: [0, 0, 0, 50], //change number 6 to increase nspace
          },
        },
        defaultStyle: {
          font: "Kanit",
          // alignment: 'justify'
        },
      };
      pdfMake.createPdf(dd).open();
      /*  pdfMake.createPdf(dd).open({}, window) */
      const getBase64Image = (url) => {
        const img = new Image();
        img.setAttribute("crossOrigin", "anonymous");
        img.onload = () => {
          const canvas = document.createElement("canvas");
          canvas.width = img.width;
          canvas.height = img.height;
          const ctx = canvas.getContext("2d");
          ctx.drawImage(img, 0, 0);
          const dataURL = canvas.toDataURL("image/png");
          console.log(dataURL);
        };
        img.src = url;
      };
    },
  },
};
</script>
